// AddCar.js
import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';

function AddCar() {
    const [newCar, setNewCar] = useState({ modelo: '', marca: '', ano: '', categoria: '', disponibilidade: false });
    const history = useHistory();

    const handleAddCar = () => {
        fetch('http://localhost:25000/data', {
            method: 'POST',
            headers: { 'Content-Type': 'application/json' },
            body: JSON.stringify(newCar)
        })
        .then(() => history.push('/'))
        .catch(error => console.error("Erro ao adicionar o carro:", error));
    };

    return (
        <div>
            <h2>Adicionar Carro</h2>
            <input type="text" placeholder="Modelo" onChange={e => setNewCar({ ...newCar, modelo: e.target.value })} />
            <input type="text" placeholder="Marca" onChange={e => setNewCar({ ...newCar, marca: e.target.value })} />
            <input type="number" placeholder="Ano" onChange={e => setNewCar({ ...newCar, ano: e.target.value })} />
            <input type="text" placeholder="Categoria" onChange={e => setNewCar({ ...newCar, categoria: e.target.value })} />
            <label>
                Disponibilidade:
                <input type="checkbox" onChange={e => setNewCar({ ...newCar, disponibilidade: e.target.checked })} />
            </label>
            <button onClick={handleAddCar}>Adicionar</button>
        </div>
    );
}

export default AddCar;
